import Head from "next/head";
import Link from "next/link";
import { useEffect } from "react";

import Nav from "./nav";

const header = () => {
    useEffect(() => {
        
    });

    return (
        <header className="d-flex align-items-center fs-2 text-white">
            <Head>
                <title>msg.gg</title>
                <link rel="stylesheet" href="/style/header.css" />
                <link
                    href="https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@300;400;700&display=swap"
                    rel="stylesheet"
                ></link>
                <script src="/js/app.js"></script>
            </Head>
            <div className="header__logo col-2">
                <img class="pointer" src="https://kr-cdn.maple.gg/images/images/maplegg_logo2_white.svg" alt=""/>
            </div>
            <div className="header__nav h-100 col-2">
                <Nav></Nav>
            </div>
            <div className="header__login d-flex align-items-center pointer">
                <img src="data:image/png;base64," alt=""/>
            </div>
        </header>
    );
};

export default header;
